import React, { useState } from "react";
import TodoDetails from "./TodoDetails";

function CrudOp() {
  const todoLists = [
    { id: 1, title: "Read", details: "I will love to read today" },
    { id: 1, title: "Dance", details: "I will love to dance today" },
    { id: 1, title: "Jump", details: "I will love to jump today" },
    { id: 1, title: "Sing", details: "I will love to sing today" },
    { id: 1, title: "Stand", details: "I will love to stand today" },
    { id: 1, title: "Code", details: "I will love to code today" },
    { id: 1, title: "Sleep", details: "I will love to sleep today" },
  ];

  const [todos, setTodos] = useState(todoLists);
  return (
    <div className="container">
      <h1>My Note App</h1>
      <div className="flex-row">
        <div className="flex-large">
          <h2>Add Todo</h2>
        </div>
        <div className="flex-large">
          <h2>View Todo(s)</h2>
          <TodoDetails todos={todos} />
        </div>
      </div>
    </div>
  );
}

export default CrudOp;
